import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import { SchemaChoose } from "../schema-choose/index.schema-choose";
import { Grid } from "@mui/material";

const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-35%, -35%)",
  width: "80vw",
  bgcolor: "background.paper",
  border: "2px solid #000",
  boxShadow: 24,
  height: "90vh",
  p: 4,
};

export default function ModalToSetNameNode({
  closeDisabled = false,
  open = false,
  selectedNode,
  handleClose,
  getNodeName,
  generateFile,
  handleConnectSnippetToNode,
}: {
  closeDisabled?: boolean;
  open: boolean;
  selectedNode?: string;
  handleClose: () => void;
  getNodeName(nodeName: string): void;
  generateFile(): void;
  handleConnectSnippetToNode: (snippetId: number) => void;
}) {
  const handleChange = (event: { target: { value: string } }) => {
    getNodeName(event.target.value);
  };

  return (
    <Modal
      sx={{ width: "80vw", height: "80vh", minWidth: "80vw" }}
      open={open}
      onClose={closeDisabled ? ((() => null) as any) : handleClose}
      aria-labelledby="keep-mounted-modal-title"
      aria-describedby="keep-mounted-modal-description"
    >
      <Grid
        sx={style}
        display={"grid"}
        container
        item
        spacing={2}
        rowSpacing={2}
        gap={2}
        width={"100%"}
      >
        <TextField
          id="outlined-basic"
          label="Element Name"
          variant="outlined"
          onChange={handleChange}
        />
        <SchemaChoose
          selectedNode={selectedNode}
          handleConnectSnippetToNode={handleConnectSnippetToNode}
        />
        <Grid display={"flex"} justifyContent={"right"} sx={{ height: "2rem" }}>
          <Button disabled={closeDisabled} onClick={() => handleClose()}>
            Close
          </Button>
          <Button onClick={() => generateFile()}>Generate</Button>
        </Grid>
      </Grid>
    </Modal>
  );
}
